import React from 'react'
import './FondoImagen.css'
import Informacion from '../informacion/Informacion'

function FondoImagen(props) {
  const{datosVideos}=prop
  return (
    <div className='fondo_imagen'>
      <Informacion />
    </div>
  )
}

export default FondoImagen
